import React from "react";
import { useSpring, animated } from "@react-spring/web";

type RectangleProps = {
  width: number;
  height: number;
  x: number;
  y: number;
  fill?: string;
};

export const Rectangle = (props: RectangleProps) => {
  const { x, y, width, height, fill = "#9d174d" } = props;

  const springProps = useSpring({
    from: {
      width,
      height: 0,
      x,
      y: y + height, // Start from bottom
    },
    to: {
      width,
      height,
      x,
      y,
    },
    config: {
      mass: 1,
      tension: 180,
      friction: 30,
    },
  });

  if (y === undefined) {
    return null;
  }

  return (
    <animated.rect
      x={springProps.x}
      y={springProps.y}
      width={springProps.width}
      height={springProps.height}
      opacity={0.7}
      stroke={fill}
      fill={fill}
      fillOpacity={0.3}
      strokeWidth={1}
      rx={1}
    />
  );
};

export default Rectangle;
